export const config = {
    apiUrl:'http://127.0.0.1:8000/api/',
    webUrl:'http://localhost:3000/',
    HeaderRequest:{
        baseUrl:'http://localhost:3000/',
        ContentType:'application/json',
    },
    routeApi:{
        user:'user/users',
        navigation:'general/navigation',
        wargas:'warga/wargas',

    }
 };
